FUNCTION Determine_type (Prate,Lrate,LS_change) RESULT( flag )
  REAL(kind=dp) :: Prate(NVAR),Lrate(NVAR)
  INTEGER ::Vdot(NVAR),PP(10),ap,flag,I,LS_change
  flag=0
  Vdot=0
  !WHERE (abs(Prate)>=thresholds .or. abs(Lrate)>=thresholds) Vdot=1
  WHERE (abs(Prate)>=10 .or. abs(Lrate)>=10) Vdot=1
  PP(1)=SUM(Vdot(LS_ind_1))
  PP(2)=SUM(Vdot(LS_ind_2))
  PP(3)=SUM(Vdot(LS_ind_3))
  PP(4)=SUM(Vdot(LS_ind_4))
  PP(5)=SUM(Vdot(LS_ind_5))
  PP(6)=SUM(Vdot(LS_ind_6))
  PP(7)=SUM(Vdot(LS_ind_7))
  PP(8)=SUM(Vdot(LS_ind_8))
  PP(9)=SUM(Vdot(LS_ind_9))
  PP(10)=SUM(Vdot(LS_ind_10))
  if(LS_change>0)PP(4)=1!this is used to reduce errors in halogen species
  WHERE (PP>=1) PP=1
  ap=sum(LS_bin_base*PP)
  flag=all_types(ap+1)
  if(flag>20)flag=13!set to full chemistry
END FUNCTION Determine_type

